// import _ from 'lodash'
import { CART_ADD } from '../actions/cart'
let initial = {}

export default function (state = initial, action) {
  switch (action.type) {
    case CART_ADD:
      console.log({ [action.id]: action.colors })
      return { [action.id]: action.colors }

    default:
      return state
  }
}
